import { InfoSection, Pricing, InfoSectionLeft } from '../../components';

function Home() {
  return (
    <>


      <InfoSection {...homeObjHero} />
      {/* hero image */}

      <InfoSection {...homeObjOfer1} />
      {/* oferta 1 */}

      <InfoSection {...homeObjOfer2} />
      {/* oferta 2 lewa */}

      <InfoSection {...homeObjOfer1} />
      {/* oferta 3 */}

      <InfoSection {...homeObjTwo} />
      <Pricing />
      <InfoSection {...homeObjThree} />

      <InfoSection {...homeObjFour} />
    </>
  );
}

export default Home;
